import { Link } from 'react-router-dom';
import './Navigation.css';
import { useDispatch, useSelector } from 'react-redux';
import { handleFetchUsers } from '../../asyncActions/users';

function Navigation () {
    const dispatch = useDispatch();
    const users = useSelector(state => state.users);

    return (
        <nav>
            <ul>
                <li><Link to="/posts">Posts</Link></li>
                <li><Link to="/todo">Todo</Link></li>
                <li onClick={() => dispatch(handleFetchUsers())}>{users}<Link to="/users">Users</Link></li>
                {/* <button onClick={() => dispatch(handleFetchUsers())}>New</button> */}
                {/* <button onClick={usersDisplay}>New</button> */}
            </ul>
        </nav>
    )
}

export default Navigation;
